import Container from '../components/Container';
import Slider from '../components/Slider';
import Tips from '../components/Tips';

const Index = () => {
  return (
    <Container>
      <Slider />
      <Tips />
      <style jsx global>
        {`
          :root {
            /* Colors  */
            --wolox-green: #9fc739;
            --wolox-blue: #00a7e8;
            --light-grey: #f2f5fa;
          }
          * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
          }
          html {
            width: 100%;
            font-family: 'Montserrat', sans-serif;
          }
        `}
      </style>
    </Container>
  );
};
export default Index;
